let typed = new Typed("#typed", {
    stringsElement: "#typed-strings",
    typeSpeed: 30,
    onComplete: function () {
        document.querySelector(".typed-cursor").style.display = "none", document.querySelector("#footer").style.display = "block"
    }
});

const img = document.querySelector("#profile-image");

window.addEventListener("load", function(){
    img.src = imgSrc.before;
});

img.addEventListener("mouseover", function(){
    img.src = imgSrc.after;
});
img.addEventListener("mouseout", function(){
    img.src = imgSrc.before;
});

let imgSrc = {
    after: "data:image/png;base64,",
    before: "data:image/png;base64,"
}

